webpackJsonp([96801168001813],{1103:function(e,t){e.exports={data:{site:{siteMetadata:{title:"Psyked: James' Web Development website",author:"James Ford"}},markdownRemark:{id:"/Users/James/Repositories/portfolio-2018/src/posts/cool-stuff-in-google-image-details/index.md absPath of file >>> MarkdownRemark",html:'<p>![A screenshot of the Google+ Image details panel](/content/images/2011/07/google-plus-image-shot.png "Google+ Image Details")</p>\n<p>There are of course many cool things in [Google+](<a href="http://plus.google.com">http://plus.google.com</a> "Open Google+ in a new Window."), but here\'s one that piqued my interest on the Geek-factor.</p>\n<p>When you upload images to Google+ it goes to the trouble of extracting the images\' metadata and producing an histogram of the image data - as shown in the screenshot above. I\'d guess there\'s more on the way, judging from the tab-style interface that currently exists.</p>\n<p>If this sort of stuff interests you, you might like to check out some of the Flash-based histogram and image metadata projects that already exist - the [Histogram](<a href="http://je2050.joa-ebert.com/imageprocessing/de/popforge/imageprocessing/core/Histogram.html">http://je2050.joa-ebert.com/imageprocessing/de/popforge/imageprocessing/core/Histogram.html</a> "Open the class reference for the Histogram class in a new Window") class of Joa Eberts\' Imageprocessing Library for histograms [[link](<a href="http://blog.joa-ebert.com/imageprocessing-library/">http://blog.joa-ebert.com/imageprocessing-library/</a> "Open Joa Eberts\' Imageprocessing Library in a new Window.")] and on image metadata the ["Finding celebrity locations via Twitter — Celebrity Exif data mining"](<a href="http://zaalabs.com/2010/07/finding-celebrity-locations-via-twitter/">http://zaalabs.com/2010/07/finding-celebrity-locations-via-twitter/</a> "Finding celebrity locations via Twitter — Celebrity Exif data mining") post from nate of ZaaLabs.</p>',frontmatter:{title:"Cool stuff in Google+ - Image details",date:"July 17, 2011",tags:["image-processing"],url:null,image:null,description:null}}},pathContext:{prev:{frontmatter:{path:"/blog/a-rather-crude-fql-syntax-pretty-printer/",tags:["facebook"],title:"A (rather crude) FQL syntax pretty-printer.",date:"2011-06-14T20:08:34.000Z"}},next:{frontmatter:{path:"/blog/having-trouble-with-workspaces-in-appcelerator-titanium/",tags:null,title:"Having trouble with workspaces in Appcelerator Titanium?",date:"2011-07-19T09:05:51.000Z"}}}}}});
